import React from 'react'
import SearchBar from './SearchBar'
import { Box } from '@mui/system'
import { Grid } from '@mui/material'

export default function Search() {
    return (
        <Grid container justify="center" alignItems="center">
            <Grid item xs={10}>
                <SearchBar />
            </Grid>
        </Grid>
    )
}
